import Feature from "./Feature";
import "./Benefits.css"

export default function Benefits() {
    const features = [
        {
            name: "Vida cotidiana saludable",
            icon: 'cardiology'
        }
    ]

    return (
        <div id={"benefits"}>
            <div id={"features"}>
                {
                    features.map(({icon, name}, index) => <Feature name={name} icon={icon} key={index}/>)
                }
            </div>
        </div>
    )
}
